import React from "react";
import "./List.css";

function List({ data }) {
  return (
    <div className="list__container">
      <ul className="list__items">
        <li className="list__item">Demand</li>
        <li className="list__item">Material Transfer</li>
        <li className="list__item">Stored Procedures</li>
        <li className="list__item">Masters</li>
        <li className="list__item">Transportation</li>
        <li className="list__item">Payments</li>
      </ul>
    </div>
  );
}

export default List;
